import React from 'react';
import {
  Typography, FormControl, InputLabel, Input, FormHelperText
} from '@material-ui/core';

export default () => {
    return (
        <React.Fragment>
            <Typography variant="h4">Mash</Typography>
            <FormControl>
                <InputLabel htmlFor="field1">Field 1</InputLabel>
                <Input id="field1" aria-describedby="field1-helper" />
                <FormHelperText id="field1-helper">Field 1 Helper</FormHelperText>
            </FormControl>
        </React.Fragment>
    );
}
